package services;import model.IesireEntity;import model.IntrareViewEntity;import model.RegistruAOUGEntity;import model.RegistruAOUGViewEntity;import model.RegistruOGBViewEntity;import model.repository.IesireRepository;import model.repository.IntrareViewRepository;import model.repository.RegistruAOUGRepository;import model.repository.RegistruAOUGViewRepository;import model.repository.RegistruOGBViewRepository;import org.springframework.beans.factory.annotation.Autowired;import org.springframework.stereotype.Service;import org.springframework.transaction.annotation.Transactional;import java.sql.Timestamp;import java.util.List;@Servicepublic class RegistruServiceImpl implements RegistruService {    @Autowired    private RegistruAOUGRepository registruAOUGRepository;    @Autowired    private RegistruAOUGViewRepository registruAOUGViewRepository;    @Autowired    private IesireRepository iesireRepository;    @Autowired    private IntrareViewRepository intrareViewRepository;    @Autowired    private RegistruOGBViewRepository registruOGBViewRepository;    @Override    @Transactional    public RegistruAOUGEntity save(RegistruAOUGEntity entity) {        entity.setRezervat(0);        entity.setAnulat(0);        entity.setFormatFizic(0);        entity.setCreatDe(UserUtils.getLoggedInUsername());        entity.setCreatLa(new Timestamp(System.currentTimeMillis()));        return registruAOUGRepository.save(entity);    }    @Override    @Transactional    public RegistruAOUGEntity update(RegistruAOUGEntity entity) {        return null;    }    @Override    @Transactional    public List<IntrareViewEntity> findAllIntrari() {        return (List<IntrareViewEntity>) intrareViewRepository.findAll();    }    @Override    @Transactional    public List<IesireEntity> findAllIesiri() {        return (List<IesireEntity>) iesireRepository.findAll();    }    @Override    @Transactional    public List<RegistruAOUGViewEntity> findAllAOUG() {        return (List<RegistruAOUGViewEntity>) registruAOUGViewRepository.findAll();    }    @Override    @Transactional    public List<RegistruOGBViewEntity> findAllOGB() {        return (List<RegistruOGBViewEntity>) registruOGBViewRepository.findAll();    }}